import React from 'react';
import ReactDOM from 'react-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChevronDown } from '@fortawesome/free-solid-svg-icons';
import { Button } from 'react-bootstrap';
import 'components/UI/LoginButton/LoginButton.css';


const loginButton = (props) => {
    return(
        props.loggedIn ? <div className="loginName">{props.displayName} <FontAwesomeIcon icon={faChevronDown} /></div> 
        : <Button href="http://localhost:8888" variant="nav">Login to Spotify</Button>
    );
    };

export default loginButton;
